import './App.css';
import Login from './Login';
import Home from './Home';
import { BrowserRouter, Route, Switch } from 'react-router-dom';


function App() {
  return (

    <BrowserRouter>

      <div className="App">
        <h1>MySportsHub</h1>
        <div>
          <Switch>
            <Route path="/" exact component={Login} />

            <Route path="/Home" component={Home} />
          </Switch>
        </div>
      </div>
    </BrowserRouter>

  );
}

export default App;
